VALUES ('3240931544335', 'Gnocchis à poêler extra raclette', 'Pâte à gnocchi : 70 % (eau, semoule de _blé_ dur, flocons de pomme de terre (pommes de terre déshydratées, émulsifiant : mono et diglycérides d\'acides gras, anti-oxydant: acide ascorbique, épice:curcuma), huile de colza, sel), Garniture : 30 % (_crème_ fraiche, raclette (_lait_ de vache pasteurisé, sel, ferments lactiques, coagulant, conservateurs: lysozyme d\'_œuf_ - natamycine, colorant: E160b) 5,7 %, fromage fondu pour tartiflette (_fromages_ 3 %, beurre, eau, amidons transformés, protéines de _lait_, (_lait_ écrémé en poudre, sels de fonte: acide citrique, citrate de sodium, polyphosphates, gélifiant: carraghénanes) (_œuf_) 5,4 %, mozzarella (_lait_ de vache pasteurisé, sel, ferments lactiques, coagulant, acide citrique, antiagglomérant : cellulose ou amidon de pomme de tere) 5,4 %, semoule de _blé_ dur, flocons de pomme de terre (pommes de tere déshydratées, émulsifiant:mono et diglycérides d\'acides gras, anti-oxydant : acide ascorbique, épice : curcuma), oignons frits, huile de tournesol), huile de colza, arômes, arôme de fumée, sel). Enrobage: farine de blé.', 'https://static.openfoodfacts.org/images/products/324/093/154/4335/front_fr.4.400.jpg', '8.3', '4.2', '27', '1.3', '', '7.5', '1.6', '0.62992125984252', '', '0');

