INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3240931544366', 'Linguine', 'Eau, pâtes Linguine : 31,5% (semoule de _blé_ dur, eau, _œufs_ frais, sel), _crème_ UHT (stabilisant : carraghénanes), graines de _soja_ 4,1%, _saumon_ cuit (_saumon_ 2.8%, sel, acidifiant : acide citrique) 2,9%, _saumon_ fumé 1.9%, huile de colza, échalote, lait de coco en poudre (lait de coco 0.5%, maltodextrine, protéines de _lait_) 0,6%, amidon transformé, tomate purée, sel, arôme naturel (_lait_), émulsifiant : lécithine de _soja_, zeste de citron jaune 0.2%, poudre de jaune d\'_œufs_, sirop de glucose, coriandre, épaississant : gomme xanthane, ail, conservateurs : sorbate de potassium-acétate de sodium, poivre. Informations en gras destinées aux personnes allergiques.   Produit fabriqué dans un atelier utilisant des crustacés, fruits à coque et céleri.  Malgré toutes les précautions prises lors de la préparation du saumon, la présence exceptionnelle d\'une arête reste possible. Conditionné sous atmosphère protectrice.', 'https://static.openfoodfacts.org/images/products/324/093/154/4366/front_fr.4.400.jpg', '6.9', '2.9', '18', '0.9', '1.1', '5.4', '0.75', '0.295275590551181', '', '1');

