VALUES ('3240931544373', 'Girasoli chèvre & tomates confites', 'Farce:60% (fromage de chèvre (lait de chèvre pasteurisé, sel, ferments lactiques et fongiques, coagulant) 9,3%, tomates confites 9,3 %, ricotta (lactoserum, lait, sel, correcteurs d\'acidité: acide citrique, acide lactique) 8 %, crème fraiche, tomate purée 6%, huile d\'olive vierge extra, flocons de pomme de terre (pommes de terre déshydratées, émulsifiant mono et diglycérides d\'acides gras, anti-oxydant: acide ascorbique, épice: curcuma), chapelure (farine de blé, eau, sel, levure), figues sèches 2,8%, farine de riz, oignon déshydraté, sel, ail, fibres d\'inuline, origan 0,4%, arômes (lait). Pâte: 40 % (semoule de blé dur, ceufs frais, eau). Pourcentages exprimés sur le produit total. Informations en gras destinées aux personnes allergiques. Peut contenir des traces de fruits à coque.', 'https://static.openfoodfacts.org/images/products/324/093/154/4373/front_fr.15.400.jpg', '11', '4.4', '30', '3.1', '3', '9', '1.3', '0.511811023622047', '', '0');

