VALUES ('3242274004651', 'Salade & Compagnie - Auvergnate', '=&gt; Conchiglie et fusilli cuits 55% (eau, semoule de <strong>blé</strong> dur, <strong>œuf</strong>, sel, épices, piment doux), salade verte 14%, tomates cerises 8%, jambon cru fumé 7% (viande de porc, sel, épices, plantes aromatiques, antioxydant : ascorbate de sodium, conservateur : nitrite de sodium), <strong>fromage</strong> à pâte persillé 7%, <strong>noix</strong> 3%, huile de tournesol, huile d’olive vierge, jus de citron, persil, ferments. (% exprimés sur la salade) Cette salade peut contenir des traces et de <b>soja.</b> =&gt; Sauce vinaigrette 25g : huile de colza, vinaigre balsamique de Modène 39% [vinaigre de vin (<strong>sulfites</strong>), moût de raisin, colorant : E150d], huile d’olive vierge, sel. (% exprimés sur la sauce) =&gt; Cookie pépites de chocolat 18g : farine de <strong>blé</strong>, pépites de chocolat 23% (sucre, pâte de cacao, beurre de cacao, poudre de cacao maigre, émulsifiant : lécithine de tournesol, arôme vanille), sucre, huile de colza, <strong>beurre</strong> concentré, <strong>œuf</strong>, sucre roux, eau, sel, poudres à lever : E450, E500, amidon de <strong>blé</strong>. (% exprimé sur le cookie) =&gt; 3 gressins 15g : farine de <strong>blé</strong>, eau, huile d’olive vierge, romarin, levure boulangère, graines de pavot, sel, semoule de <strong>blé</strong> dur, sucre. Porc : Origine UE', 'https://static.openfoodfacts.org/images/products/324/227/400/4651/front_fr.13.400.jpg', '13', '3.2', '21', '2.8', '1.4', '7.5', '0.9', '0.354330708661417', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3242274005054', 'Salade & compagnie Olympe (Boulgour, crudités, fromage de brebis, jambon speck et olives)', 'Boulgour cuit 28% [boulgour (gluten), eau, sel], salade verte 13%, quinoa cuit [eau, quinoa (gluten) sel], blé dur cuit (eau, blé dur précuit, sel), pois chiches, tomates cerises 8%, fromage de brebis 5%, concombre 5%, jambon speck 5% (viande de porc, sel, épices, plantes aromatiques, antioxydant : E301, conservateur : E250), olives noires aromatisées 2% (olives noires, sel, huile de tournesol, herbes de Provence), huile de tournesol, huile d’olive vierge extra, jus de citron, menthe. (% exprimés sur la salade) Cette salade peut contenir des traces de soja et d’œuf. Vinaigrette 25g : eau, vinaigre de Xérès (sulfites), huile de tournesol, huile d’olive vierge extra 11%, purée de mandarine 10% (mandarine, sirop de sucre inverti), préparation à l’orange sanguine 9% (concentré d’orange sanguine, huile essentielle d’orange), sel. (% exprimés sur la vinaigrette). Cookie au chocolat 20g : farine de blé, sucre roux, pépites de chocolat 17% (sucre, pâte de cacao, beurre de cacao, cacao maigre en poudre, émulsifiant : lécithine de tournesol, arôme vanille), beurre, jaune d\'œuf, blanc d\'œuf, poudre de cacao, sel, poudre à lever : E450i, E500ii, amidon de blé. 3 gressins 15g: farine de blé, eau, graines de pavot, huile d’olive vierge extra, romarin, levure boulangère, sel, semoule de blé dur, sucre.', 'https://static.openfoodfacts.org/images/products/324/227/400/5054/front_fr.3.400.jpg', '7.8', '2.6', '19.1', '3.6', '', '6.1', '0.70104', '0.276', '', '1');

