VALUES ('3242274006556', 'Salade & Compagnie - Libanaise', '=&gt; Semoule réhydratée 25%(eau, semoule de <strong>blé</strong> dur, sel, curcuma), falafel 16% [eau, pois chiches, oignon, coriandre, huile de tournesol, flocon de pomme de terre (pomme de terre, antioxydant : extrait de romarin), farine de <strong>blé</strong>, ail, menthe, sel, cumin, stabilisant : gomme de cellulose, piment doux, poivre noir], salade verte 14%, eau, tomates cerises 8%, boulgour (<strong>gluten</strong>), courgette marinée 5%, raisin sec 3% (agent enrobage: huile de coton), concombre 3%, poivron rouge mariné 2%, poivron jaune mariné 1%, huile de colza, oignon mariné, oignon rouge mariné, menthe, jus de citron, sel, sucre, ail, thym, romarin, basilic et origan, poivre, ferments. (% exprimés sur la salade) Cette salade peut contenir des traces d’<b>œuf, </b>de <b>soja</b>, de <b>poisson</b>, de <b>crustacés</b>, d’<b>arachide</b>, et de <b>lait.</b> =&gt; Sauce au yaourt et à la menthe 25g : <strong>yaourt</strong> 0% de matières grasses 68%, eau, huile de colza, purée de citron jaune, vinaigre de xérès, menthe 2,5%, sel, sucre, amidon de maïs, ail. (% exprimés sur la sauce) =&gt; Biscuit citron Pavot 18g : farine de <strong>blé</strong>, sucre, huile de colza, <strong>œuf</strong>, <strong>beurre</strong> concentré, purée de citron 4%, zeste de citron 1%, graines de pavot 1%, sel, poudres à lever : E450, E500, amidon de <strong>blé</strong>, arômes naturels. (% exprimé sur le biscuit) =&gt; 3 gressins 15g : farine de <strong>blé</strong>, eau, huile d’olive vierge, romarin, levure boulangère, sel, graines de pavot, semoule de <strong>blé</strong> dur, sucre.', 'https://static.openfoodfacts.org/images/products/324/227/400/6556/front_fr.13.400.jpg', '4.5', '0.7', '22.1', '5.9', '2.8', '4.3', '0.5', '0.196850393700787', '', '1');

