INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3242274007553', 'Salade & Compagnie - Bombay', 'Salade composée de riz cuit, de légumes cuisinés, de poulet rôti traité en salaison au curry, de salade et tomates avec une sauce vinaigrette aux agrumes. Ingrédients: =&gt; Riz cuit 32% (eau, riz, sel, épices), poulet rôti traité en salaison épicé 14% (viande de poulet 12%, eau, huile de tournesol, épices (curry, curcuma, poivre noir), sel, dextrose, fécule de manioc, arôme naturel), salade verte 14%, courgette 10%, tomates cerises 8%, carotte 7%, poivron rouge 3%, poivrons rouge et jaune grillés, raisin sec (agent enrobage : huile de coton), ciboulette, épices, huile de tournesol, ail, huile de colza, purée de piment, gingembre, huile d\'olive vierge, jus de citron, ferments. (% exprimés sur la salade) Cette salade peut contenir des traces de gluten, oeuf, soja et lait. =&gt; Sauce vinaigrette 25g : vinaigre de Xérès ( sulfites), huile de colza, eau, huile d\'olive vierge 10%, purée de mandarine 10%, concentré d\'orange sanguine 9% (concentré d\'orange sanguine, huile essentielle d\'orange), sel. (%exprimés sur la sauce) =&gt; Cookie pépites de chocolat 18g : farine de blé, pépites de chocolat 23% (sucre, pâte de cacao, beurre de cacao, poudre de cacao maigre, émulsifiant : lécithine de tournesol, arôme vanille), sucre, huile de colza, beurre concentré, sucre roux, blanc d\'oeuf, jaune d\'oeuf, eau, sel, poudres à lever : E450, E500, amidon de blé. (% exprimé sur le cookie) =&gt; 3 gressins 15g : farine de blé, eau, huile d\'olive vierge, romarin, levure boulangère, sel, graines de pavot, semoule de blé dur, sucre. Poulet : Origine UE', 'https://static.openfoodfacts.org/images/products/324/227/400/7553/front_fr.15.400.jpg', '7.2', '1.2', '18', '3.9', '1.6', '4.7', '0.6', '0.236220472440945', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3242274008055', 'Salade & Compagnie Bergerac : Pommes de terre, Salade, Gésiers de Canard, Tomate et Noix', 'Salade :  Pomme de terre cuite 52 % (pomme de terre, eau, sel épices), salade verte 14 %, gésier de canard traité en salaison 13 % (gésier de canard maigre 13 %, graisse de canard, sel, arômes, antioxydant : E301, conservateur : E250), tomate cerise 8 %, _noix_ 5 %, oignon grillé, ciboulette, huile d\'olive vierge, huile de tournesol, vinaigre de vin rouge au jus de framboise (vinaigre de vin rouge, jus de framboise, arôme, arôme naturel, conservateur : E222), flocons de pomme de terre (pomme de terre, antioxydant : extrait de romarin), ferment. (% exprimé sur la salade) Vinaigrette 25 g : huile de tournesol, vinaigre de vin rouge au jus de framboise (vinaigre de vin rouge, jus de framboise 1,4 %, arôme, arôme naturel, conservateur : sulfites), huile d\'olive vierge 17 %, purée de framboise sucrée (framboise 10 %, sirop de sucre inverti), sel, échalote déshydratée. (% exprimé sur la vinaigrette) Cookie pépite de chocolat 18 g : farine de _blé_, pépites de chocolat 23 % (sucre, pâte de cacao, beurre de cacao, poudre de cacao maigre, émulsifiant : lécithine de tournesol, arôme vanille), sucre, huile végétale raffinée (colza), _beurre_ concentré, blanc d\'_œuf_, eau, sel, poudre à lever : E450, E500, amidon de _blé_. (% exprimé sur le cookie) 3 gressins 15 g : farine de _blé_, eau, huile d\'olive vierge, romarin, levure boulangère, graines de pavot, sel, semoule de _blé_ dur, sucre.', 'https://static.openfoodfacts.org/images/products/324/227/400/8055/front_fr.10.400.jpg', '7.2', '1.6', '16', '6.8', '', '6.6', '0.48', '0.188976377952756', '', '1');

