VALUES ('3242274500054', 'Mon atelier salade - Poulet caesar', 'Salade composée 90%: Salade, oeuf, viande de poulet, tomate mi-séchée, fromage 5%, farines (blé, blé malté, fèves, d\'orge malté torréfiée), eau, huile d\'olive vierge, huiles végétales (colza, tournesol), vinaigre d\'alcool, gluten de blé, son de blé, amidon de maïs, fécule de manioc, levure boulangère, sucre, dextrose, ferments, émulsifiants E471, E481, conservateur E1105, agent de traitement de la farine E300, sel, arôme naturel, plantes aromatiques, ail, poivre. Peut contenir des traces de sésame.  Sauce Cæsar 10% : huile de colza, eau, parmesan, jus de citron, graines de moutarde, vinaigre d\'alcool, purée de mandarine, jaune d\'ceuf, sel, amidon de maïs, épaississant: gomme xanthane, poivre, basilic, ail.', 'https://static.openfoodfacts.org/images/products/324/227/450/0054/front_fr.47.400.jpg', '10', '2.4', '6.6', '1.6', '2.3', '9.9', '0.92', '0.362204724409449', '', '0');

